from sympy import divisors
def sd(n): return sum(map(int, str(n)))
def f(n): return sum(sd(d) for d in divisors(n, generator=True))
def a(n):
    i, c = 10**n, 0
    while i != 15: i = f(i); c += 1
    return c
print([a(n) for n in range(1, 82)]) # _Michael S. Branicky_, Dec 10 2021

